import { useParams } from 'react-router-dom';
import image from './images/im8.jpg';
import { useEffect, useState } from 'react';
import { toast } from 'react-toastify';
import {  editbranchDetails } from "./services/branch";
import { Link, useNavigate } from "react-router-dom";
import "./common.css";

import { updateBranch as updateBranchApi } from "./services/user";
import { log } from "./utils/utils";

function Edit()
{
    const [branch, setbranch]=useState({branchName:"", branchCode:"",branchLocation:"",branchManager:""});
   const {branchId} = useParams();
   const [branchName, setBranchName] = useState("");
   const [branchCode, setBranchCode] = useState("");
   const [branchLocation, setBranchLocation] = useState("");
   const [branchManager, setBranchManager] = useState("");

const getBranchDetailsToEdit = async (branchId)=>
{
    debugger;
    const response = await editbranchDetails(branchId);
    debugger;
    if(response!==null){
      setbranch(response);
    }
    else{
        toast.error("branch not found");
        }
}

    useEffect(()=>{
        getBranchDetailsToEdit(branchId)
    },[])


    const updateBranch = async () => {
        debugger;

        if (branchName.length == "") {
          toast.error("Please enter first name");
        } else if (branchCode.length == "") {
          toast.error("Please enter last name");
        } else if (branchLocation.length == "") {
          toast.error("Please enter email");
        } else if (branchManager.length == "") {
        } else {
          const response = await updateBranchApi(
            branchName,
            branchLocation,
            branchCode,
            branchManager
          );


          if (response.status === true) {
            toast.success("Successfully registered a new user");
            log(response.data);
            // go back to login
            navigate("/");
          } else {
            toast.error("Error while registering a new user, please try again");
          }
        }
      };
    return(

          <div style={{backgroundImage:`url(${image})`}} >
              <div className="lengths">
            <div>

            </div>
            <center>
            <table className='b'>
                        <tr>
                            <td>
                                Enter Branch Name
                            </td>
                            <td className='td'></td>
                            <td>
                               <input type="text" placeholder='Branch Name' value={branch.branchName}  onChange={(e) => {
                      setBranchName(e.target.value)
                    }}/>
                            </td>
                        </tr><tr className='tr'>

                        </tr>
                        <tr>
                            <td>
                                Enter Branch Location
                            </td>
                            <td className='td'></td>
                            <td>
                               <input type="text" placeholder='Branch Location' value={branch.branchLocation}  onChange={(e) => {
                      setBranchLocation(e.target.value)
                    }}/>
                            </td>
                        </tr><tr className='tr'>

                        </tr>
                        <tr>
                            <td>
                                Enter Branch Code
                            </td>
                            <td className='td'></td>
                            <td>
                               <input type="text" placeholder='Branch Code' value={branch.branchCode}  onChange={(e) => {
                      setBranchCode(e.target.value)
                    }}/>
                            </td>
                        </tr><tr className='tr'>

                        </tr>
                        <tr>
                            <td>
                                Enter Branch Manager
                            </td>
                            <td className='td'></td>
                            <td>
                               <input type="text" placeholder='Branch Code' value={branch.branchManager}  onChange={(e) => {
                      setBranchCode(e.target.value)
                    }}/>
                            </td>
                        </tr>
                        <tr className='tr'>

                        </tr>
                        <tr>
                            <center>
                                <td>
                                    <button className='btn btn-primary' onClick={updateBranch}>Update Branch</button>
                                </td>
                            </center>
                        </tr>

                    </table>
                    </center>
          </div>
        </div>
        )
}
export default Edit;
